    // max 一般排序
    private void normalSort(List<int> numList)
    {
        int maxNum = 0;

        int index = 0;
        int temp;

        for (int i = 0; i < numList.Count; i++)
        {
            maxNum = 0;
            for (int j = i; j < numList.Count; j++)
            {
                int num = numList[j];
                if (num > maxNum)
                {
                    index = j;
                    maxNum = num;
                }

                if (j == (numList.Count - 1))
                {
                    temp = maxNum;
                    numList[index] = numList[i];
                    numList[i] = temp;
                }
            }
        }

        string str = "";
        for (int i = 0; i < numList.Count; i++)
            str += numList[i] + ",";

        Debug.LogError(str);
    }

    // max 自己優化的排序
    private void fastSort(List<int> numList)
    {

        QuickSort(0, (numList.Count - 1), numList);


        string str = "";
        for (int i = 0; i < numList.Count; i++)
            str += numList[i] + ",";

        Debug.LogError(str);
    }

