        int temp = 0;

        // left >= pivot 往右一格, right <= pivot 往左一格
        while (left != right)
        {
            // 先處理right
            while (right != left && numList[right] <= pivot)
            {
                right--;

                // ----
                //if (right == left)
                //    break;

                //if (numList[right] <= pivot)
                //    right--;
                //else
                //    break;
            }

            // 後處理left
            while (left != right && numList[left] >= pivot)
            {
                left++;

                // --------
                //if (left == right)
                //    break;

                //if (numList[left] >= pivot)
                //    left++;
                //else
                //    break;
            }
            // left與right做交換
            temp = numList[left];
            numList[left] = numList[right];
            numList[right] = temp;
        }

        // 跳出後與基數做交換
        numList[leftIndex] = numList[left];
        numList[left] = pivot;


        // 進行遞迴，left和right是最後到達的位置，由它來當分隔點
        QuickSort(leftIndex, left - 1, numList);
        QuickSort(right + 1, rightIndex, numList);
    }
}
